const initialState = {
  images: [],
  selectedImage: null,
};

function appReducer(state = initialState, { type, payload }) {
  switch (type) {
    case 'UPLOAD_IMAGES':
      // eslint-disable-next-line no-console
      console.log('hello from reducer', payload);
      return state;
    default:
      return state;
  }
}

export default appReducer;
